			new[] { Environment.NewLine },
			StringSplitOptions.None).ToList();
		// remove header
		statsStringList.Remove(statsStringList.First());

		foreach(var statsStringRow in statsStringList)
		{
			var propList = statsStringRow.Split(',').ToList();

			if (propList.Count() > 0)
			{
